    description: "The good old snake game.",
    github: ""
  },

  // {
  //   id: 6,
  //   //image: ,
  //   title: "kl",
  //   description: "",
  //   github: ""
  // }
]



const Product = () => {
  return (
    <section id="product">
      <h1 className="portfolio__section-title">Projects</h1>

      <div className="container portfolio__container">
        {
          data.map(({id, title, description, github}) => {
            return(
              <div className="p">
                <div className="p-browser">

                </div>
                <article key={id} className="portfolio__item">
                  <div className="portfolio__item-image">
                    {/* <img src={image} alt={title}/> */}
                  </div>
                  <h3 className="portfolio__section-card-title">{title}</h3>
                  <h3 className="portfolio__section-description">{description}</h3>
                  <div className="portfolio__item-cta">
                    <a href={github} className="btn" target="_blank">Github</a>
                  </div>
                </article>
              </div>
            )
          })
        }

      </div>
    </section>
  )
}

export default Product;

